description:
These young little sweethearts might be home from school, but the real action is just getting started! Sabrina Banks, Alina Li, Rose Black, and Jade Nile are about to go balls deep into their extra curricular activities. Join them for an extra special cramming session, because there are some things that you can only learn in the after school program!

